import React from 'react';
import Webform from './Webform.js';
import Figures from './Figures';
import { Row, Col } from 'antd';


 const HomePage = () => {
     return (
   <Row>
         <Col span={50}>
             <Webform/>
         </Col>
         

         <Col span={50}>
             <Figures dimesions={renderobjects}/>
         </Col>
    </Row>

     );
 }

 export default HomePage;
